    @Test
    public void CreatePatientPreferencesString() {
        try {
            CdaPdfSerializer oSerializer = new CdaPdfSerializer();
            POCDMT000040ClinicalDocument oCda = oSerializer.deserialize(CDA_EXAMPLE1_PART1 + CDA_EXAMPLE1_PART2);

            CdaPdfExtractor oExtractor = new CdaPdfExtractor();
            BinaryDocumentPolicyCriterionType oCriterion = oExtractor.extractBinaryDocumentPolicyCriterion(oCda);
            BinaryDocumentPolicyCriteriaType oCriteria = new BinaryDocumentPolicyCriteriaType();
            oCriteria.getBinaryDocumentPolicyCriterion().add(oCriterion);

            PatientPreferencesType oPtPref = new PatientPreferencesType();
            oPtPref.setBinaryDocumentPolicyCriteria(oCriteria);

            oPtPref.setPatientId("1111");
            oPtPref.setOptIn(true);
            oPtPref.setFineGrainedPolicyMetadata(new FineGrainedPolicyMetadataType());

            PatientPreferencesSerializer oPtPrefSerializer = new PatientPreferencesSerializer();
            String sPtPref = oPtPrefSerializer.serialize(oPtPref);

            System.out.println(sPtPref);
        } catch (Exception e) {
            fail("An unexpected exception occurred.  Error: " + e.getMessage());
        }

    }
